            }

            if (keys && keys[49]) {
                cheese();

            if (keys && keys[50]) {
                lettuce();
            }

                sourCream();
            }

            }

        function everyInterval(n) {
            if ((frameNo / n) % 1 == 0) { return true; }
            return false;
        }
        let creditsActive = false;
        function credits() {
            if (!creditsActive) {
                document.getElementById('credits').style.display = 'block';
                creditsActive = true;
            } else if (creditsActive) {
                document.getElementById('credits').style.display = 'none';
                creditsActive = false;
            }
        }
        let infoActive = false;
        function info() {
            if (!infoActive) {
                document.getElementById('info').style.display = 'block';
                infoActive = true;
            } else if (infoActive) {
                document.getElementById('info').style.display = 'none';
                infoActive = false;
            }
        }

        function clickTaco() {
            if (clickTacoTimer == 0) {
                money += (Math.round(10000 * moneyValue) / 100) * 5;
                clickTacoTimer = 500;
                clickSound.play();
            }
        }

        function save() {
            localStorage.setItem('money', money);
            localStorage.setItem('diamonds', diamonds);

            // Cheese:
            localStorage.setItem('cheeseCost', cheeseCost);
            localStorage.setItem('cheeseNum', cheeseNum);
            localStorage.setItem('cheeseTotal', cheeseTotal);
            // Lettuce:
            localStorage.setItem('lettuceCost', lettuceCost);
            localStorage.setItem('lettuceNum', lettuceNum);
            localStorage.setItem('lettuceTotal', lettuceTotal);
            // Sour Cream:
            localStorage.setItem('sourCreamCost', sourCreamCost);
            localStorage.setItem('sourCreamNum', sourCreamNum);
            localStorage.setItem('sourCreamTotal', sourCreamTotal);
            // Meat:
            localStorage.setItem('meatCost', meatCost);
            localStorage.setItem('meatNum', meatNum);
            localStorage.setItem('meatTotal', meatTotal);
            // Taco Yumminess:
            localStorage.setItem('tacoYumminessCost', tacoYumminessCost);
            localStorage.setItem('tacoYumminessNum', tacoYumminessNum);
            localStorage.setItem('tacoYumminessTotal', tacoYumminessTotal);
            // Tomatoes:
            localStorage.setItem('tomatoesCost', tomatoesCost);
            localStorage.setItem('tomatoesNum', tomatoesNum);
            localStorage.setItem('tomatoesTotal', tomatoesTotal);
            // Evolve:
            localStorage.setItem('evolveNum', evolveNum);
            localStorage.setItem('multiplier', multiplier);
            localStorage.setItem('moneyPerSecNextEvolve', moneyPerSecNextEvolve);
            localStorage.setItem('moneyPerSecNextEvolveDisplay', moneyPerSecNextEvolveDisplay);
            // Misc.:
            localStorage.setItem('clickTacoTimer', clickTacoTimer);
            clickSound.play();
        }
        function load() {
            money = parseFloat(localStorage.getItem('money'));
            diamonds = parseFloat(localStorage.getItem('diamonds'));

            // Cheese:
            cheeseCost = parseFloat(localStorage.getItem('cheeseCost'));
            cheeseNum = parseFloat(localStorage.getItem('cheeseNum'));
            cheeseTotal = parseFloat(localStorage.getItem('cheeseTotal'));
            // Lettuce:
            lettuceCost = parseFloat(localStorage.getItem('lettuceCost'));
            lettuceNum = parseFloat(localStorage.getItem('lettuceNum'));
            lettuceTotal = parseFloat(localStorage.getItem('lettuceTotal'));
            // Sour Cream:
            sourCreamCost = parseFloat(localStorage.getItem('sourCreamCost'));
            sourCreamNum = parseFloat(localStorage.getItem('sourCreamNum'));
            sourCreamTotal = parseFloat(localStorage.getItem('sourCreamTotal'));
            // Meat:
            meatCost = parseFloat(localStorage.getItem('meatCost'));
            meatNum = parseFloat(localStorage.getItem('meatNum'));
            meatTotal = parseFloat(localStorage.getItem('meatTotal'));
            // Taco Yumminess:
            tacoYumminessCost = parseFloat(localStorage.getItem('tacoYumminessCost'));
            tacoYumminessNum = parseFloat(localStorage.getItem('tacoYumminessNum'));
            tacoYumminessTotal = parseFloat(localStorage.getItem('tacoYumminessTotal'));
            // Tomatoes:
            tomatoesCost = parseFloat(localStorage.getItem('tomatoesCost'));
            tomatoesNum = parseFloat(localStorage.getItem('tomatoesNum'));
            tomatoesTotal = parseFloat(localStorage.getItem('tomatoesTotal'));
            // Evolve:
            evolveNum = parseFloat(localStorage.getItem('evolveNum'));
            multiplier = parseFloat(localStorage.getItem('multiplier'));
            moneyPerSecNextEvolve = parseFloat(localStorage.getItem('moneyPerSecNextEvolve'));
            moneyPerSecNextEvolveDisplay = localStorage.getItem('moneyPerSecNextEvolveDisplay');
            // Misc.:
            clickTacoTimer = parseFloat(localStorage.getItem('clickTacoTimer'));
            clickSound.play();
            document.getElementById('load').style.display = 'none';
            startGame();
        }
